from typing import List

class Solution:
    # The function below is the correct one. It should work even for all negative numbers.
    def maxSubArray(self, nums: List[int]) -> int:
        max_current = max_global = nums[0]
        for i in range(1, len(nums)):
            max_current = max(nums[i], max_current + nums[i])
            if max_current > max_global:
                max_global = max_current
        return max_global
    # I think the function below will not work for all negative numbers.
    def kadane(self, nums: List[int]) -> int:
        max_sum = float('-inf')
        curr_sum = 0
        for n in nums:
            curr_sum = max(curr_sum + n, n)
            max_sum = max(max_sum, curr_sum)
        return max_sum

